import React from 'react'
import Banner from './Banner';
import './Homescreen.css'
import Navbar from './Navbar';
import Row from './Row'
import userrequest from '../tmdbfile/request';
function Homescreen() {
  return (
    <>
     <div className='homescreen'>
         <Navbar/>
         <Banner/>
        <Row title='Trending Now' isLargeRow fetchurl={userrequest.fetchTrending }/>
        <Row title='Comedy Movie'  fetchurl={userrequest.fetchComedyMovies}/>
        <Row title='Horror Movie' fetchurl={userrequest.fetchHorrorMovies}/>
        <Row title='Romaance Movie' fetchurl={userrequest.fetchRomanceMovies}/>
      </div>
    </>
   
  )
}

export default Homescreen;
